import { Container } from 'react-bootstrap';

const AboutMe = () => {
	const styles = {
        background: {
			background: 'black',
		},
		heading: {
			fontSize: '6rem',
		},
	};
	return (
		<>
			<Container>
				<p>Welcome!</p>
				<h2 style={styles.heading} className='fw-bold'>
					Steve Martin
				</h2>
				<h3 className='fw-bold'>Full Stack Web Developer</h3>
				<p>
					a Full stack developer student . <br />
					
				</p>
			</Container>
		</>
	);
};

export default AboutMe;
